To solve the last bullet point, we will create another else block after the two existing branches. Inside this block, the player will be told that they have guessed the correct number and the program will be stopped. For that, we will use a break statement which will break out of the infinite loop, and since there is nothing after the loop, the program will end. The malb8dge equivalent of a break statement is %. After adding all of that, you should get this: guess > number ? { ;"Too high!"
} ! guess < number ? { ;"Too low!"
} ! { ;"You guessed the number!" %
} If we put these if expressions into our infinite loop and add a few finishing touches, our first llittle malb8dge project is finished! ;"Guess the number!" number = 1 ?\ 100 ? { guess = _("Your guess: ") guess > number ? { ;"Too high!" } ! guess < number ? { ;"Too low!" } ! { ;"You guessed the number!" % }
} Awesome! You have now learnt about some basic malb8dge syntax. In the next chapter, we will take a look at how we can compact the code that we've written in this chapter.

